export default (function(a,b,c,d,e,f,g,h,i){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:d,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:d,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:e,pageSize:25,pageCount:e,total:5}}},QZetqDGToJ:{data:{id:482,attributes:{imdbId:"tt0075704",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BZmVmNWQ1YzUtZTNmOS00NzhhLTlhNjQtMGZlYzZiOGE5ZWE1XkEyXkFqcGdeQXVyNzc5MjA3OA@@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"5.8\u002F10"},{Source:"Rotten Tomatoes",Value:"53%"}],item_lang:{data:{id:1145,attributes:{title:f,plot:"In New York City, Janice Templeton (Marsha Mason) is happily married to executive Bill Templeton (John Beck) and they live in a comfortable and fancy apartment with their eleven-year-old daughter Ivy (Susan Swift). One day, Janice is stalked by a weirdo and she tells her husband. Soon afterwards, the stranger contacts them and invites the couple to meet him in a restaurant. Elliot Hoover (Sir Anthony Hopkins) tells Janice and Bill that his daughter Audrey Rose died eleven years ago, burned in a car crash, and her soul has been reincarnated in Ivy's body. Bill and Janice believe that Elliot is nuts, and Bill tells his lawyer to get a restraining order against Elliot. However, Ivy has dreadful nightmares and only Elliot is able to calm her down. When Elliot abducts Ivy, Bill and Janice go to court to have him arrested. But Elliot wants to prove that Ivy and Audrey Rose are the same soul.",slug:"audrey-rose"}}},books:{data:[{id:3731,attributes:{title:f,description:"When Elliot Hoover loses his wife and daughter, Audrey Rose, in a fiery car crash, his world explodes. To heal his mental anguish and claim some peace, he visits a psychic who reveals to him that his daughter has been reincarnated into Ivy Templeton, a young girl living in New York City. Desperate to reclaim anything from his daughter's past, he searches out Ivy, only to discover that the unbelievable is shockingly true-his daughter is back. Now, in an effort to save her life, Hoover must choose between two horrifying possibilities-leaving his daughter's soul in torment, or taking the life of the young girl in whom she now lives.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Ud84AQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[g],firstBook:true,published:h,publisher:i,subtitle:a}},{id:3732,attributes:{title:"For Love of Audrey Rose",description:"The sequel to Audrey Rose takes Janice Templeton back to the death of Audrey Rose and the mystery of where she is if she was reincarnated as Ivy Templeton. Ivy, Janice's daughter, was also killed in a car crash. Janice is determined to find the truth.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=0Vs3AQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[g],firstBook:c,published:h,publisher:i,subtitle:a}},{id:3733,attributes:{title:"The Science Fiction and Fantasy Film Handbook",description:"This book is a comprehensive and detailed guide to a genre of enduring popular appeal. Several hundred films are covered in entries that provide technical credits and cast lists, a plot synopsis, and a quotation from a contemporary review√≥complimentary or otherwise. The films are illustrated by over 200 stills. More than 50 biographies of movie personalities, including performers, directors, producers, and writers, are supplied. In addition, the author has written a series of short essays on major themes in science fiction and fantasy films.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=ReDZoGcGjq4C&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Alan G. Frank"],firstBook:c,published:"1982-01-01",publisher:"Barnes & Noble Imports",subtitle:a}},{id:3734,attributes:{title:"The Essential Murders of Seven Movie Critics",description:"The Essential Murders of Seven Movie Critics, is a thriller of one woman's revenge against seven American movie critics whose viciously caustic reviews caused the suicide of her husband, the miscarriage of their baby and the total collapse of their world.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=oohVBkIXCLoC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Frank DeFelitta"],firstBook:c,published:"2006-07-01",publisher:"Xlibris Corporation",subtitle:a}},{id:3735,attributes:{title:"Dark Discoveries - Issue #24",description:"Forgotten Horror and SciFi TV ABC Movies of the Week Darkroom & William F. Nolan \"The Group\" & TV Dark Shadows Kathryn Leigh Scott Interview, Dark Shadows Overview, Movie Review And More Frank De Felitta, Jeffrey Reddick, Jonathan Maberry, David Morrell, Gene O'Neill, Eric Red Table of Contents Wayne Miller COVER ART F i c t i o n They - by David Morrell Coyote Gambit - by Gene O'Neil Do Not Disturb - by Eric Red The Partnership - by William F. Nolan Masks - by Brian Sammons I n t e r v i e w s Katherine Leigh Scott Interview - James R. Beach David Morrell Interview - Joel Kirkpatrick Gene O'Neill Interview - Joel Kirkpatrick Jeffrey Reddick Interview - Cyrus Wraith Walker Eric Red interview - Aaron French Bob Morrish column (Frank De Felitta Interview) F e a t u r e s Dark Shadows article (overview) - Stephen Mark Rainey ABC Movie of the Week article - Mark Seiber and James R. Beach The Group and Television article - Trever Nordgren Darkroom article - Trever Nordgren Column - by Dr. Michael Collings Double X Chromosome: Why I hate Women in Horror - Yvonne Navarro YA and YA reviews - by Amy Shane Things that Bite - Jonathan Maberry and David F. Kramer NONFICTION WHC\u002FHWA wrapup\u002Fwinners Ray Harryhausen Tribute - Aaron French Hellnotes Reviews Book reviews",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=U8qingEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Jonathan Maberry"],firstBook:c,published:"2013-07-01",publisher:a,subtitle:a}}]}}},meta:{}}},prerenderedAt:1681377239327}}("","movie",null,"series",1,"Audrey Rose","Frank De Felitta","2009-02-28","Hachette UK"))